import {Route,Routes}from "react-router-dom"

import Header from "./Header";
import SearchBar from "./SearchBar";
import List from "./List";
import EmploeePage from './EmploeePage';

import contactsArray from "../data";

const contact = contactsArray.map((elem, i) => {
  return <List key={i} {...elem} />;
});


export default function HomePage(props) {
  return (
    <div className="homepage">
        <div className="homapagebody">
            <Header />
             <SearchBar />
            <List contact = {contact}/>
      </div>
      <div className="emploeebody">
            <Routes>
                <Route path = "/:id" element = {<EmploeePage/>}/>
            </Routes>
        </div>
    </div>
  );
}
